import React from "react";
import "./listcard.css";
function ListCard() {
  return (
    <div className="list_card">
      <div className="info">
        <h3>Python with Django</h3>
        <p>অনলাইন , সময়ঃ রাত ০৮ : ০০ টা</p>
      </div>
    </div>
  );
}

export default ListCard;
